<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Document</title>
    <link rel="stylesheet" href="./index.css" />
    <script src="./index.js"></script>
  </head>
  <body>
    <div class="page">
      <div class="repo-name-wrapper-i0"><span class="repo-name">Repo Name</span></div>
      <div class="repo-name-wrapper-i1"><span class="repo-name-1">Repo Name</span></div>
      <div class="wrapper-inner">
        <div class="primary">
          <div class="view">
            <img
              class="layer"
              src="https://ai-sample.oss-cn-hangzhou.aliyuncs.com/test/71acab90ab3511eb880d5f8bbaae378c.png"
            /><img
              class="item"
              src="https://ai-sample.oss-cn-hangzhou.aliyuncs.com/test/72cee470ab3511ebafeb015a2cc745bd.png"
            />
          </div>
          <span class="name">name</span><span class="login">login</span><span class="bio-api">bio (API)</span
          ><img
            class="text-background"
            src="https://ai-sample.oss-cn-hangzhou.aliyuncs.com/test/73243060ab3511eb80d71b65c7413f00.png"
          />
        </div>
        <div class="sub-i0">
          <div class="view-i0">
            <span class="tag">访问</span><span class="repo-name-2">Repo Name</span
            ><span class="description">Description</span>
            <div class="mask"></div>
          </div>
          <div class="view-i1">
            <span class="label">访问</span><span class="repo-name-3">Repo Name</span
            ><span class="description-1">Description</span>
            <div class="overlayer"></div>
          </div>
        </div>
        <div class="sub-i1">
          <div class="view-i0-1">
            <span class="word">访问</span><span class="repo-name-4">Repo Name</span
            ><span class="description-2">Description</span>
            <div class="layer-1"></div>
          </div>
          <div class="view-i1-1">
            <span class="tag-1">访问</span><span class="repo-name-5">Repo Name</span
            ><span class="description-3">Description</span>
            <div class="mask-1"></div>
          </div>
        </div>
      </div>
      <div class="wrapper-inner-1">
        <div class="header">
          <img
            class="icon-house"
            src="https://ai-sample.oss-cn-hangzhou.aliyuncs.com/test/7347e500ab3511ebb364c95ea64458b4.png"
          /><span class="blog">blog</span>
        </div>
        <div class="body">
          <img
            class="icon"
            src="https://ai-sample.oss-cn-hangzhou.aliyuncs.com/test/736c35e0ab3511eb80ea277521cb9315.png"
          /><span class="email">email</span>
        </div>
      </div>
      <div class="wrapper-inner-2">
        <div class="primary-1">
          <img
            class="dot"
            src="https://ai-sample.oss-cn-hangzhou.aliyuncs.com/test/738b7db0ab3511ebb4fd1f9938779d6b.png"
          /><span class="publicrepos">public_repos</span>
        </div>
        <div class="sub-i0-1">
          <span class="label-1">访问</span><span class="repo-name-6">Repo Name</span
          ><span class="description-4">Description</span>
          <div class="overlayer-1"></div>
        </div>
        <div class="sub-i1-1">
          <span class="word-1">访问</span><span class="repo-name-7">Repo Name</span
          ><span class="description-5">Description</span>
          <div class="layer-2"></div>
        </div>
      </div>
    </div>
